import React from 'react'
import {
    View,
    Text,
    StyleSheet,
    Image
} from 'react-native'

const ProductItem = () => {
    return (
        <View style={styles.container}>
            <View>
                <Text>Ashutosh</Text>
            </View>
            <View>
                <Text>this is product item area</Text>
            </View>
        </View>
    )
}

export default ProductItem

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: "row",
        justifyContent: "center"
    }
})
